template<int ROWS, int COLS, int SRC_T, int DST_T, int NPC, int TC>
void xfChannelCombineKernel(
  hls::stream< typename DataType<SRC_T,NPC>::name >& _in1,
  hls::stream< typename DataType<SRC_T,NPC>::name >& _in2,
  hls::stream< typename DataType<SRC_T,NPC>::name >& _in3,
  hls::stream< typename DataType<SRC_T,NPC>::name >& _in4,
  hls::stream< typename DataType<DST_T,NPC>::name >& _out,uint16_t height,uint16_t width)
{

 typename DataType<SRC_T,NPC>::name val1, val2, val3, val4;

 uchar_t channel1, channel2, channel3, channel4;

const int noofbits = DataType<SRC_T,NPC>::bitdepth;
ap_uint<13> i,j,k;
 RowLoop:
 for( i = 0; i < height; i++)
 {
#pragma HLS LOOP_FLATTEN off
#pragma HLS LOOP_TRIPCOUNT min=ROWS max=ROWS
  ColLoop:
  for( j = 0; j < width; j++)
  {
#pragma HLS LOOP_TRIPCOUNT min=TC max=TC
   typename DataType<DST_T,NPC>::name res;

   val1 = (typename DataType<SRC_T,NPC>::name)(_in1.read());
   val2 = (typename DataType<SRC_T,NPC>::name)(_in2.read());
   val3 = (typename DataType<SRC_T,NPC>::name)(_in3.read());
   val4 = (typename DataType<SRC_T,NPC>::name)(_in4.read());

   ProcLoop:
   for (k = 0; k < (noofbits<<xfNPixelsPerCycle<NPC>::datashift); k += noofbits)
   {
#pragma HLS UNROLL
    int y = k * DataType<DST_T,NPC>::channel;
    channel1 = val1.range(k+(noofbits-1), k);
    channel2 = val2.range(k+(noofbits-1), k);
    channel3 = val3.range(k+(noofbits-1), k);
    channel4 = val4.range(k+(noofbits-1), k);

    uint32_t result = ((uint32_t)channel3 << 0) |
      ((uint32_t)channel2 << noofbits) |
      ((uint32_t)channel1 << noofbits*2)|
      ((uint32_t)channel4 << noofbits*3);

    res.range(y+(DataType<DST_T,NPC>::pixelwidth-1), y) = result;
   }
   _out.write((typename DataType<DST_T,NPC>::name)res);
  }
 }
}

